import logo from '../../assets/img/logo.svg'

function Header() {
  return (
    <header>
        <div className="dsmeta-logo-container">
            <img src= {logo} alt="DSMeta" />
            <h1>Sales Management Dashboard</h1>
            <p>
              Desenvolvido por
              <a href="https://www.ruipina.netfily.app">Rui Pina</a>
            </p>
        </div>
    </header>
  )
}

export default Header;
